import React, { useState } from 'react';
import './App.css'; // Import your CSS file

const App = () => {
  const [teamNumber, setTeamNumber] = useState('');
  const [responseData, setResponseData] = useState(null);

  const handleInputChange = (event) => {
    setTeamNumber(event.target.value);
  };

  const handleSubmit = () => {
    // Make a cURL request to the Google Sheets API
    const apiUrl = `https://sheets.googleapis.com/v4/spreadsheets/1htzgArSyLu9kyl6Ed1SB4v_w5jiAn8oof7icfOzc1l8/values/B${teamNumber}`;
    const accessToken = 'ya29.a0AfB_byDe0jdjEiBUsGO4cVv59MZTuPGnRsxtLrzJ_8UA5yZy8QedL3cw_wmmjLWxv-_F319rDKokdEH0hV3J_-FvThz3qdthwZWyhGscEBt5SiZGOsqywR2oRZyLei2nTWehvdDHJsqaLbvBy0XKJrPbnF9PJTqXkShpaCgYKAX8SAQ8SFQHGX2MiPE9VZTQqib2r6pRqCin77g0171';
    fetch(apiUrl, {
      headers: {
        Authorization: `Bearer ${accessToken}`,
      },
    })
      .then(response => response.json())
      .then(data => {
        // Store the response data in state
        setResponseData(data);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  };
  return (
    <div className="app-container">
      <h1 className="heading">Flag <br></br>Wars</h1>
      <p className="sub-heading">Brought to you by Team Technoinformals</p>
      <div className="input-container">
        <label htmlFor="teamNumber">Enter Your Team Number:</label>
        <input
          type="text"
          id="teamNumber"
          value={teamNumber}
          onChange={handleInputChange}
        />
      </div>
      <button className="submit-button" onClick={handleSubmit}>Submit</button>
      {responseData && (
        <div>
          <p>Response from Google Sheets API:</p>
          <pre>{JSON.stringify(responseData, null, 2)}</pre>
        </div>
      )}
    </div>
  );
};

export default App;
